import React from 'react'


function Greet() {
return(<h1>Hello Ajay..!!</h1>)
}
const Login = () => {
    return (
        <>
            <h1>This is loggin page.</h1>
            <input type='text' name='name' />
            <input type='text' name='number' />
            <button onClick={Greet}>Submit</button>
        </>
    )
}

export default Login;
